import styled from "styled-components"

export const Title = styled.h1`
    font-family: 'Poppins';
    font-style: normal;
    font-size: 16px;
    color: #1D1617;
    text-align: center;
    position: absolute;
`;

export const Header = styled.div`
    background: red;
    height: 64px;
    align-items: center;
    justify-content: center;
    display: flex;
`;

export const Container = styled.div`
    background: #FFFFFF;
`;

export const HeaderButtonLeft = styled.button`
    margin-left: 10px;
    left: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;
export const View1 = styled.div`
    position: absolute;
    width: 315px;
    height: 50px;
    left: 30px;
    top: 102px;
    background: red;
    border-radius: 16px;
`;
export const Box2 = styled.div`
    position: absolute;
    width: 315px;
    height: 50px;
    left: 30px;
    top: 162px;
    background: red;
    border-radius: 16px;
`;
export const Box3 = styled.div`       
    position: absolute;
    width: 315px;
    height: 50px;
    left: 30px;
    top: 222px;
    background: red;
    border-radius: 16px;
`;
export const Box4 = styled.div`       
    position: absolute;
    width: 315px;
    height: 50px;
    left: 30px;
    top: 282px;
    background: red;
    border-radius: 16px;
`;
export const Text1 = styled.text`
    width: 51px;
    height: 150px;
    left: 75px;
    top: 118px;
    font-family: 'Poppins';
    font-style: normal;
    font-weight: 400;
    font-size: 12px;
    line-height: 18px;
    color: #7B6F72;
`;
